export default function Practice() {
  return (
    <div className='container' style={{ display: 'flex', gap: '20px', justifyContent: 'center', alignItems: 'center'}}>
        <div style={{ background: 'grey', width: '30px', height: '30px', borderRadius: '100px', display: 'flex', justifyContent: 'center', alignItems: 'center', color: 'white', fontWeight: 'bold', position: 'absolute' }}>-</div>
